import {
  Card,
  Row,
  Col,

} from "antd";

function App() {
  return (
    <div className="App">
      <>
        <Row justify="center">
          <Col>
            <Card style={{ width: "100VW", height: 100 }}>
              <p level={1}>Register Form</p>
            </Card>
          </Col>
        </Row>
        <br />
        <br />
      </>
    </div>
  );
}

export default App;
